import React from 'react'

import styles from './Footer.module.css'

const footer = () => {
    return (
        <footer id={styles.footer}>

            {/* ----------- Footer Top ---------- */}

                {/* ----------- CONTACT ---------- */}

                {/* --------- MENU -------- */}
                <div id={styles.menu}>
                    <h4>MENU</h4>
                    <ul>
                        <li>About</li>
                        <li>Projects</li>
                        <li>Skills / Interests</li>
                        <li>Contact</li>
                    </ul>
                </div>

                {/* --------- Right Side -------- */}

            {/* --------- Footer Bottom -------- */}

        </footer>
    )
}

export default footer;
